INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(1, 'Atlético Nacional', 36.00, 'Atlético Nacional es uno de los clubes más grandes y laureados de Colombia, con una rica historia en el fútbol sudamericano. Fundado en 1947, el equipo paisa ha ganado múltiples títulos de la Liga Colombiana y es reconocido por su dominio en torneos internacionales, destacando sus dos Copas Libertadores (1989 y 2016). Su estadio, el Atanasio Girardot, es un fortín donde sus hinchas, la apasionada hinchada Verdolaga, hacen sentir su apoyo incondicional. Nacional es famoso por su juego ofensivo, su cantera de talentos y su filosofía de mantener un fútbol dinámico y vistoso.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(2, 'América de Cali', 17.00, 'América de Cali es un club histórico del fútbol colombiano, conocido por su tradición y gran afición. Fundado en 1927, ha conquistado numerosos títulos nacionales y es uno de los equipos más populares del país. En la década de los 80 y 90, fue protagonista en la Copa Libertadores, alcanzando varias finales. Su estadio, el Pascual Guerrero, se convierte en un hervidero cuando el equipo escarlata juega de local. América es famoso por su juego aguerrido y la pasión de su hinchada, conocida como \"La Mechita\". Su regreso a la élite tras años en segunda división lo ha consolidado como un club de renombre.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(3, 'Deportivo Cali', 12.00, 'Deportivo Cali es uno de los clubes más tradicionales y exitosos de Colombia. Fundado en 1912, es reconocido por su destacada labor en divisiones menores y por ser uno de los pocos equipos con estadio propio, el imponente Palmaseca. Ha conseguido múltiples títulos de la Liga Colombiana y fue subcampeón de la Copa Libertadores en 1999. Su estilo de juego se ha caracterizado por la técnica y el buen trato del balón. Su hinchada, conocida como los \"Azucareros\", apoya fervientemente al equipo en cada encuentro, haciendo del Cali un rival de peso en cualquier competición.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(4, 'Deportivo Pasto', 1.00, 'Deportivo Pasto, fundado en 1949, representa a la región del sur de Colombia con orgullo y garra. Su estadio, el Departamental Libertad, es una fortaleza donde el equipo suele hacerse fuerte, especialmente por la altura y el clima de la ciudad. A lo largo de su historia, ha logrado títulos de liga y ha participado en torneos internacionales, consolidándose como un club competitivo. Su afición, fiel y apasionada, acompaña al equipo en cada desafío. El Pasto es conocido por su lucha incansable en el campo y por ser un duro rival para cualquier equipo del fútbol colombiano.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(5, 'Once Caldas', 5.00, 'Once Caldas es un equipo con historia en el fútbol colombiano y un lugar especial en el ámbito internacional. Fundado en 1961, el equipo de Manizales alcanzó la gloria máxima en 2004 al conquistar la Copa Libertadores, venciendo a gigantes del continente. Su casa, el Estadio Palogrande, ha sido testigo de sus triunfos y de una hinchada que siempre lo respalda. A lo largo de los años, ha sido un club competitivo en la liga local, con títulos y participaciones destacadas. Su estilo de juego se basa en el orden táctico y la solidez defensiva, convirtiéndolo en un equipo difícil de superar.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(6, 'Independiente Medellín', 9.00, 'El Deportivo Independiente Medellín, conocido como el \"Poderoso de la Montaña\", es uno de los clubes más tradicionales de Colombia. Fundado en 1913, ha ganado múltiples títulos de la liga y ha sido protagonista en torneos internacionales. Su hinchada, la \"Rexixtenxia Norte\", es una de las más apasionadas del país y llena el Estadio Atanasio Girardot con cánticos incesantes. Medellín es reconocido por su espíritu de lucha y su estilo de juego intenso, convirtiéndolo en un equipo competitivo en cualquier escenario. Su historia está llena de momentos gloriosos y figuras emblemáticas que han dejado huella.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(7, 'Deportes Tolima', 5.00, 'Deportes Tolima es un equipo que ha crecido de manera impresionante en el fútbol colombiano. Fundado en 1954, ha conquistado títulos de liga y ha sido protagonista en torneos internacionales, ganándose el respeto de grandes rivales. Su estadio, el Manuel Murillo Toro, es un escenario difícil para cualquier visitante. Tolima se ha caracterizado por su disciplina táctica y su habilidad para descubrir talentos que luego brillan en el exterior. Su hinchada, fiel y entusiasta, lo acompaña en cada campaña, convirtiéndolo en un club con una identidad fuerte dentro del fútbol colombiano.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(8, 'Millonarios FC', 23.00, 'Millonarios es uno de los clubes más emblemáticos y exitosos de Colombia, con una historia rica en títulos y glorias. Fundado en 1946, ha sido hogar de grandes figuras del fútbol y es conocido por su estilo de juego elegante. Con múltiples campeonatos de liga, es uno de los equipos más laureados del país. Su estadio, El Campín, es testigo de la pasión de la hinchada \"Embajadora\", que lo acompaña incondicionalmente. Millonarios ha sido un referente en el fútbol sudamericano y sigue siendo un protagonista en la lucha por los títulos nacionales e internacionales.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(9, 'Junior de Barranquilla', 14.00, 'Junior de Barranquilla es uno de los equipos más populares y exitosos de Colombia. Fundado en 1924, ha logrado múltiples títulos de la liga y es protagonista en torneos internacionales. Su estadio, el Metropolitano, es un verdadero fortín donde su apasionada hinchada, \"La Banda Currambera\", alienta con fervor. Junior se ha caracterizado por su fútbol ofensivo y por ser cuna de grandes jugadores que han brillado en el extranjero. Con una rica historia y un estilo de juego vistoso, el equipo tiburón sigue consolidándose como uno de los grandes del fútbol colombiano.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(10, 'Orsomarso SC', 0.00, 'Orsomarso SC es un club joven pero con grandes aspiraciones en el fútbol colombiano. Fundado en 2016 y con sede en Palmira, Valle del Cauca, el equipo ha demostrado un crecimiento constante en la Categoría Primera B, consolidándose como un protagonista en la lucha por el ascenso. Su nombre y escudo están inspirados en la región italiana de Orsomarso, reflejando una identidad única dentro del fútbol nacional. Con una cantera enfocada en la formación de nuevos talentos, Orsomarso se ha convertido en un semillero de jugadores que han dado el salto a equipos de primera división. Su estilo de juego dinámico y aguerrido lo hace un rival complicado en cada temporada.', );
INSERT INTO `products` (`id`, `name`, `price`, `description`, `image`) VALUES
(11, 'Atletico Nacional', 4556.00, 'Atlético Nacional es uno de los clubes más exitosos de Colombia, con sede en Medellín. Fundado en 1947, ha ganado múltiples títulos nacionales e internacionales, incluidas dos Copas Libertadores. Es reconocido por su estilo de juego ofensivo y su amplia hinchada. Juega en el estadio Atanasio Girardot y sus colores tradicionales son el verde y el blanco. Su palmarés incluye 18 ligas colombianas, 7 Copas Colombia y 4 Superligas. Ha sido cuna de grandes futbolistas y mantiene una histórica rivalidad con Independiente Medellín y Millonarios. Es un referente del fútbol sudamericano y un habitual en torneos internacionales.', );

